import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const searchParams = new URLSearchParams(location.search);
    const venueName = searchParams.get('name');
    const venueAddress = searchParams.get('address');

    if (!venueName || !venueAddress) {
      setError('Venue information is missing.');
      setLoading(false);
      return;
    }

    setTrafficData(JSON.parse(localStorage.getItem('debugInfo')));
    setLoading(false);
  }, [location.search]);

  const renderForecastChart = () => {
    if (!trafficData || !trafficData.analysis) return null;

    const chartData = trafficData.analysis.flatMap(day => 
      day.day_raw.map((value, hour) => ({
        day: day.day_info.day_text,
        hour: hour,
        traffic: value
      }))
    );

    return (
      <ResponsiveContainer width="100%" height={400}>
        <LineChart data={chartData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="hour" label={{ value: 'Hour of Day', position: 'bottom' }} />
          <YAxis label={{ value: 'Foot Traffic', angle: -90, position: 'insideLeft' }} />
          <Tooltip content={<CustomTooltip />} />
          <Legend />
          {trafficData.analysis.map(day => (
            <Line 
              key={day.day_info.day_text} 
              type="monotone" 
              dataKey="traffic" 
              data={chartData.filter(d => d.day === day.day_info.day_text)}
              name={day.day_info.day_text} 
              stroke={`#${Math.floor(Math.random()*16777215).toString(16)}`} 
            />
          ))}
        </LineChart>
      </ResponsiveContainer>
    );
  };

  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      const data = payload[0].payload;
      return (
        <div className="bg-white p-2 border border-gray-300 rounded shadow">
          <p>{`${data.day}, ${label}:00`}</p>
          <p className="font-bold">{`Foot Traffic: ${data.traffic}`}</p>
        </div>
      );
    }
    return null;
  };

  const renderVenueInfo = () => {
    if (!trafficData || !trafficData.venue_info) return null;

    const { venue_name, venue_address, venue_timezone } = trafficData.venue_info;

    return (
      <div className="mb-4">
        <h2 className="text-xl font-semibold mb-2">Venue Information</h2>
        <p><strong>Name:</strong> {venue_name}</p>
        <p><strong>Address:</strong> {venue_address}</p>
        <p><strong>Timezone:</strong> {venue_timezone}</p>
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <button
          onClick={() => navigate('/')}
          className="mb-6 text-blue-600 hover:text-blue-800"
        >
          &larr; Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            <p>Error: {error}</p>
            <p className="mt-2">The venue might not be in our database or there might be an issue with the API. Please try searching for a different venue.</p>
          </div>
        )}

        {trafficData && !loading && !error && (
          <div className="bg-white rounded-lg shadow-md p-6">
            {renderVenueInfo()}
            <h2 className="text-xl font-semibold mb-4">Weekly Foot Traffic Forecast</h2>
            {renderForecastChart()}
          </div>
        )}
      </div>
    </div>
  );
};

export default ResultsPage;
